(1216, '31/08/2020', '5 सप्टेंबर शिक्षक दिनाच्या पार्श्वभूमीवर Thank A Teacher अभियान आयोजित करणेबाबत', 'https://www.maharashtra.gov.in/site/Upload/Government%20Resolutions/Marathi/202008311800021321.pdf', 2, 3, 2020),
(1217, '43899', 'महाराष्ट्र राज्यात Mission begin again या अंतर्गत राज्य शासकीय कार्यालयातील अधिकारी/ कर्मचारी यांच्या उपस्थितीबाबत', 'https://www.maharashtra.gov.in/site/Upload/Government%20Resolutions/Marathi/202009041355161207.pdf', 2, 5, 2020),
(1218, '15/09/2020', 'राज्यातील शासकीय अध्यापक विद्यालयातील विद्यार्थ्याना सराव पाठ घेण्यासाठी उपलब्ध करून देण्यात आलेल्या शासकीय सराव पाठशाळा बंद करणेबाबत', 'https://www.maharashtra.gov.in/site/Upload/Government%20Resolutions/Marathi/202009151602285121.pdf', 2, 2, 2020),
(1219, '16/09/2020', 'मान्यताप्राप्त खाजगी प्राथमिक/माध्यमिक व उच्च माध्यमिक शाळा/तुकड्या/अतिरिक्त शाखा यांना 20 टक्के तसेच यापूर्वी 20 टक्के अनुदान उपलब्ध करुन दिलेल्या प्राथमिक/माध्यमिक शाळा व तुकड्यांना पुढील वाढीव टप्पा अनुदान देण्याबाबतच्या अटींमध्ये सुधारणा करणेबाबत. ', 'https://www.maharashtra.gov.in/site/Upload/Government%20Resolutions/Marathi/202009161717278921.pdf', 2, 10, 2020),
(1220, '16/09/2020', 'माध्यमिक शाळांतील इ. 5 वी वर्ग प्राथमिक शाळांना जोडणे व इ. 5 वी वर्गांच्या शिक्षकांचे समायोजन करण्यास तत्वत: मंजूरी देणेबाबत.', 'https://www.maharashtra.gov.in/site/Upload/Government%20Resolutions/Marathi/202009161642025321.pdf', 2, 12, 2020),
(1221, '17/09/2020', 'राष्ट्रीय शैक्षणिक धोरण-2020 च्या संदर्भात संपर्क साहित्य तयार करणे या विषयाबाबत शिक्षकांसाठी ऑनलाईन स्पर्धा आयोजित करण्याबाबत ', 'https://www.maharashtra.gov.in/site/Upload/Government%20Resolutions/Marathi/202009171309547721.pdf', 2, 0, 2020),
(1222, '17/09/2020', 'बृहन्मुंबई महानगरपालिका शाळातील मोफत ऑनलाईन शिक्षणाचा लाभ राज्यातील इतर विद्यार्थ्यांना उपलब्ध करून देणेबाबत.', 'https://www.maharashtra.gov.in/site/Upload/Government%20Resolutions/Marathi/202009171241157721.pdf', 2, 0, 2020),
