(1225, '21/09/2020', 'जिल्हा परिषदेच्या शाळेतील शिक्षक तसेच मान्यता प्राप्त खाजगी अनुदानित प्राथमिक, माध्यमिक, उच्च माध्यमिक व अध्यापक विद्यालयातील शिक्षक व शिक्षकेतर कर्मचाऱ्यांना लागू असलेली परिभाषित अंशदान निवृत्तीवेतन योजना (DCPS) केंद्राच्या राष्ट्रीय निवृत्तीवेतन योजनेत (NPS) समाविष्ट करणेबाबत. ', 'https://www.maharashtra.gov.in/site/Upload/Government%20Resolutions/Marathi/202009211703174221.pdf', 2, 48, 2020),
(1226, '25/09/2020', 'करोना विषाणु प्रसारास प्रतिबंधात्मक उपाय म्हणून घोषित केलेल्या लॉकडाऊॅनच्या कालावधीत शासकीय कार्यालयातील दिव्यांग अधिकारी/कर्मचारी यांना उपस्थितीत सुट देणेबाबत.', 'https://www.maharashtra.gov.in/site/Upload/Government%20Resolutions/Marathi/202009281320306422.pdf', 2, 13, 2020),
(1227, '29/09/2020', 'अनुसूचित जाती व नवबौध्द घटकातील मुलामुलींना शिक्षणासाठी परदेशी शिष्यवृत्ती योजना सन 2020-21 साठी विद्यार्थ्याची निवड करणेबाबत', 'https://www.maharashtra.gov.in/site/Upload/Government%20Resolutions/Marathi/202009291641391722.....pdf', 2, 7, 2020),
(1228, '29/09/2020', 'इ. 1 ली ते इ.12 वी मधील विद्यार्थ्यांचे आधार नोंदणी व अद्ययावतीकरण दि. 31 मार्च, 2021 पर्यंत करणेबाबत.', 'https://www.maharashtra.gov.in/site/Upload/Government%20Resolutions/Marathi/202009291238560121.pdf', 2, 49, 2020),
(1229, '30/09/2020', 'प्रशासनाचे शाळांच्या अडचणी सोडविण्याकरिता सक्रीय योगदान करण्यासाठी एक दिवस शाळेसाठी हा उपक्रम राबविणेबाबत.', 'https://www.maharashtra.gov.in/site/Upload/Government%20Resolutions/Marathi/202009301734113121.pdf', 2, 3, 2020),
(1230, '30/09/2020', 'शालेय स्तरावर सक्तीची मराठी भाषा अधिनियमांतर्गत नियमावली तयार करण्यासाठी समिती गठीत करण्याबाबत.', 'https://www.maharashtra.gov.in/site/Upload/Government%20Resolutions/Marathi/202009301741194421.pdf', 2, 7, 2020),
(1231, '43840', 'अनुसूचित जातीच्या मुला-मुलींसाठी शाहू, फुले, आंबेडकर निवासी/ अनिवासी शाळा योजना सुरू करणेबाबत.', 'https://www.maharashtra.gov.in/Site/Upload/Government%20Resolutions/Marathi/202010011443518422.pdf', 2, 33, 2020),
(1232, '44053', 'राष्ट्रीयकृत बॅंकांकडून प्राप्त State Government Salary Package (SGSP) अंतर्गत विमा योजनांबाबत कर्मचाऱ्यांना अवगत करणेबाबत…', 'https://www.maharashtra.gov.in/Site/Upload/Government%20Resolutions/Marathi/202010081729179805.pdf', 2, 58, 2020),
(1233, '14/10/2020', 'ज्यातील अनुसूचित जातीच्या 100 विद्यार्थ्यांना देशातील नामांकित शैक्षणिक संस्थांमध्ये उच्च शिक्षण घेण्यासाठी राजर्षि शाहू महाराज गुणवत्ता शिष्यवृत्ती योजना सन 2019-20 करीता विद्यार्थ्यांची निवड', 'https://www.maharashtra.gov.in/Site/Upload/Government%20Resolutions/Marathi/202010141109419422.pdf', 2, 20, 2020),
(1234, '14/10/2020', 'कोव्हिड-19 संबंधित कर्तव्य बजावतांना कोव्हिडमुळे मृत्यू होणाऱ्या कर्मचाऱ्यांना रु.50.00 लक्ष सानुग्रह सहाय्य लागू करण्यास मुदतवाढ देण्याबाबत', 'https://www.maharashtra.gov.in/Site/Upload/Government%20Resolutions/Marathi/202010141441140505.pdf', 2, 74, 2020);
INSERT INTO `jaipal` (`id`, `name`, `date`, `que`, `uploaderId`, `views`) VALUES
(8, 'आजची प्रश्नमंजूषा 256 वी', '15/12/2020', '\r\n\r\n१) महात्मा फुले यांनी लिहिलेला शेवटचा ग्रंथ कोणता ?\r\n२) घटकराज्याचा आणीबाणीला काय म्हणतात ?\r\n३) राज्य विधानसभेची किमान सदस्यसंख्या किती असू शकते ?\r\n४) मानवी छातीच्या पिंजऱ्यात किती बरगड्या असतात ?\r\n५) चीनचे चलन कोणते ?\r\n\r\nउत्तरे :- १) सार्वजनिक सत्यधर्म   २) राष्ट्रपती राजवट   ३) ६०   ४) २४   ५) युआन\r\n\r\n               ', 2, 556),
(9, '257 वी आजची प्रश्नमंजूषा', '16/12/2020', '<p>आजची प्रश्नमंजूषा (२५७)</p>\r\n\r\n<p>१) G. S. R. हे उपकरण कशाच्या मापनासाठी वापरतात ?</p>\r\n\r\n<p>२) ताजमहाल कोणत्या नदीच्या काठावर आहे ?</p>\r\n\r\n<p>३) शाहू महाराजांचे मूळ नाव काय होते ?</p>\r\n\r\n<p>४) साने गुरुजींच्या आईचे नाव काय होते ?</p>\r\n\r\n<p>५) युरोप व आशिया या खंडांना कोणत्या संयुक्त शब्दाने ओळखतात ?</p>\r\n\r\n<p><u>उत्तरे</u> :- १) <span style=\"color:#e74c3c\">डोळ्याची</span> <span style=\"color:#e74c3c\">क्षमता</span>&nbsp; २) <span style=\"color:#3498db\">यमुना&nbsp;</span> ३) <span style=\"color:#f39c12\">यशवंतराव</span>&nbsp; ४) <span style=\"color:#16a085\">यशोदा</span>&nbsp; ५) <span style=\"color:#2ecc71\">युरेशिया</span></p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>\r\n', 2, 406),
(10, '२५८ वी आजची प्रश्नमंजूषा', '17/12/2020', '<p>आजची प्रश्नमंजूषा (२५८)</p>\r\n\r\n<p>१) जपानचे चलन कोणते ?</p>\r\n\r\n<p>२) जगातील सर्वप्रथम कादंबरीकार लेखिका कोण ?</p>\r\n\r\n<p>३) कॉफी उत्पादनात भारतातील कोणत्या राज्याचा प्रथम क्रमांक लागतो ?</p>\r\n\r\n<p>४) महाराष्ट्रातील सर्वाधिक समुद्रकिनारा लाभलेला जिल्हा कोणता ?</p>\r\n\r\n<p>५) तांदळाचे सर्वाधिक उत्पादन घेणारे भारतातील राज्य कोणते ?</p>\r\n\r\n<p>उत्तरे :- १) <span style=\"color:#2ecc71\">येन</span>&nbsp; २) <span style=\"color:#e74c3c\">मुरासाकी</span> <span style=\"color:#e74c3c\">शिकिबु</span>&nbsp; &nbsp;३) <span style=\"color:#3498db\">कर्नाटक</span>&nbsp; &nbsp;४) <span style=\"color:#9b59b6\">रत्नागिरी</span>&nbsp; &nbsp;५) पश्चिम बंगाल</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>\r\n', 2, 218),
(11, '259 वी आजची प्रश्नमंजूषा', '18/12/2020', '<p>आजची प्रश्नमंजूषा (२५९)</p>\r\n\r\n<p>१) &#39;काळे खंड&#39; असे कोणत्या खंडाला म्हणतात ?</p>\r\n\r\n<p>२) ताग उत्पादनात भारतातील कोणत्या राज्याचा प्रथम क्रमांक लागतो ?</p>\r\n\r\n<p>३) लालबहादूर शास्त्री यांचे आडनाव काय होते ?</p>\r\n\r\n<p>४) गोबर गॅस ( बायोगॅस ) मध्ये कोणता वायू असतो ?</p>\r\n\r\n<p>५) महाराष्ट्रातील एकमेव सागरी अभयारण्य कोठे आहे ?</p>\r\n\r\n<p>उत्तरे :- १) <span style=\"color:#1abc9c\">आफ्रिका</span>&nbsp; &nbsp;२) <span style=\"color:#9b59b6\">पश्चिम</span> <span style=\"color:#9b59b6\">बंगाल</span>&nbsp; &nbsp;३) <span style=\"color:#e74c3c\">श्रीवास्तव</span>&nbsp; ४) <span style=\"color:#f39c12\">मिथेन</span>&nbsp; ५) <span style=\"color:#3498db\">मालवण</span></p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</p>\r\n', 2, 192),
(12, '२६० वी आजची प्रश्नमंजूषा', '19/12/2020', '<p>आजची प्रश्नमंजूषा (२६०)</p>\r\n\r\n<p>१) वायुसेनेच्या प्रमुखाला काय म्हणतात ?</p>\r\n\r\n<p>२) कापूस उत्पादनात भारतातील कोणत्या राज्याचा क्रमांक लागतो ?</p>\r\n\r\n<p>३) &#39;कंगारुची भूमी&#39; असे कोणत्या देशास म्हटले जाते ?</p>\r\n\r\n<p>४) शरीरातील सर्वात मोठा अवयव कोणता ?</p>\r\n\r\n<p>५) अमेरिकेच्या सुरक्षा विभागाच्या कार्यालयाचे नाव काय आहे ?</p>\r\n\r\n<p>उत्तरे :- १) <span style=\"color:#2ecc71\">एअर</span> <span style=\"color:#2ecc71\">चीफ</span> <span style=\"color:#2ecc71\">मार्शल</span>&nbsp; २) <span style=\"color:#8e44ad\">गुजरात</span>&nbsp; ३) <span style=\"background-color:#e74c3c\">ऑस्ट्रेलिया&nbsp;</span><span style=\"color:#d35400\">४</span>) <span style=\"color:#3498db\">यकृत</span>&nbsp; &nbsp;५) <span style=\"color:#1abc9c\">पेंटागोन</span></p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</p>\r\n', 2, 186),
(13, '२६१ वी आजची प्रश्नमंजूषा', '20/12/2020', '<p><span style=\"color:#c0392b\">आजची</span> <span style=\"color:#c0392b\">प्रश्नमंजूषा</span> (<span style=\"color:#16a085\">२६१</span>)</p>\r\n\r\n<p>१) लोकसभेचे पहिले अध्यक्ष कोण होते ?<br />\r\n२) प्रकाशाची तीव्रता मोजण्याचे उपकरण कोणते ?<br />\r\n३) डॉ बाबासाहेब आंबेडकर यांना बौद्ध धम्माची दीक्षा कोणी दिली ?<br />\r\n४) जे. आर. डी. टाटा यांचे पूर्ण नाव काय ?<br />\r\n५) &#39;कोकबोरोक&#39; ही भारतातील कोणत्या राज्याची अधिकृत भाषा आहे ?</p>\r\n\r\n<p>उत्तरे :- १) <span style=\"color:#1abc9c\">गणेश</span> <span style=\"color:#1abc9c\">वासुदेव</span> <span style=\"color:#1abc9c\">मावळकर</span>&nbsp; २) <span style=\"color:#e74c3c\">फोटोमीटर</span>&nbsp; &nbsp;३) <span style=\"color:#9b59b6\">भन्ते</span> <span style=\"color:#9b59b6\">चंद्रमणि</span> <span style=\"color:#9b59b6\">महास्थविर</span>&nbsp; ४) <span style=\"color:#f39c12\">जहांगीर</span> <span style=\"color:#f39c12\">रतनजी</span> <span style=\"color:#f39c12\">दादाभाई</span> <span style=\"color:#f39c12\">टाटा</span>&nbsp; ५) <span style=\"color:#2980b9\">त्रिपुरा</span></p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</p>\r\n', 2, 284),
(14, '२६२ वी आजची प्रश्नमंजूषा', '21/12/2020', '<p>आजची प्रश्नमंजूषा (२६२)</p>\r\n\r\n<p>१) महानगरपालिकेचा प्रथम नागरिक कोणास म्हणतात ?<br />\r\n३) संत चोखामेळा यांची समाधी कोठे आहे ?<br />\r\n४) मानवी रक्तात युरियाचे प्रमाण वाढल्यास काय होते ?<br />\r\n५) गरम पदार्थ गरम ठेवणाऱ्या भांड्यास काय म्हणतात ?</p>\r\n\r\n<p>उत्तरे :- १) <span style=\"color:#c0392b\">महापौर</span>&nbsp; &nbsp;२) <span style=\"color:#2980b9\">चौथा</span>&nbsp; ३) <span style=\"color:#16a085\">पंढरपूर</span>&nbsp; &nbsp;४) <span style=\"color:#c0392b\">चक्कर</span> <span style=\"color:#c0392b\">येते</span>&nbsp; ५) <span style=\"color:#8e44ad\">थर्मोवेअर</span></p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</p>\r\n', 2, 61),
(15, '२६३ वी आजची प्रश्नमंजूषा', '22/12/2020', '<p>आजची प्रश्नमंजूषा (२६३)</p>\r\n\r\n<p>१) प्राचीन काळात &#39;दक्षिण कोसला&#39; नावाने ओळखले जाणारे सध्याचे राज्य कोणते ?</p>\r\n\r\n<p>२) सिक्कीम राज्याला कोणत्या तिबेटीयन नावाने ओळखले जाते ?</p>\r\n\r\n<p>३) &#39;पूर्वेकडील स्कॉटलंड&#39; कोणत्या राज्याच्या राजधानीला म्हटले जाते ?</p>\r\n\r\n<p>४) सिंदापूर,सॅडाबूर व मिहासापट्टम ही कोणत्या राज्याची ऐतिहासिक नावे आहेत ?</p>\r\n\r\n<p>५) जम्मू काश्मीरवरील संविधानातील ३७० कलम हटविण्यापूर्वी जम्मू काश्मीर सरकार &#39;आझाद काश्मीर दिन&#39; कोणत्या दिवशी साजरा करीत होते ?</p>\r\n\r\n<p>उत्तरे :- १) <span style=\"color:#c0392b\">छत्तीसगड</span>&nbsp; २) <span style=\"color:#16a085\">डेंजॉग</span>&nbsp; ३) <span style=\"color:#8e44ad\">शिलॉंग</span>, <span style=\"color:#8e44ad\">मेघालय</span>&nbsp; ४) <span style=\"color:#2980b9\">गोवा</span>&nbsp; &nbsp;५) २४ <span style=\"color:#d35400\">ऑक्टोबर</span></p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>\r\n', 2, 29),
(16, '२६४ वी आजची प्रश्नमंजूषा', '23/12/2020', '<p>आजची प्रश्नमंजूषा (२६४)</p>\r\n\r\n<p>१) भारतातील इतर राज्यांच्या तुलनेत कोणत्या राज्यात प्रादेशिक भाषांची संख्या जास्त आहे ?</p>\r\n\r\n<p>२) &#39;डूमका&#39; हे कोणत्या राज्याच्या उपराजधानीचे शहर आहे ?</p>\r\n\r\n<p>३) कोणत्या देशात सरकारी खर्चाने दिवाळीचा कार्यक्रम साजरा केला जातो ?</p>\r\n\r\n<p>४) डॉ बाबासाहेब आंबेडकरांनी धर्मांतराची घोषणा कधी केली ?</p>\r\n\r\n<p>५) महाडचा क्रांतीस्तंभ किती फूट उंच आहे ?</p>\r\n\r\n<p>उत्तरे :- १) <span style=\"color:#c0392b\">अरुणाचल</span> <span style=\"color:#c0392b\">प्रदेश</span>&nbsp; २) <span style=\"color:#2980b9\">झारखंड</span>&nbsp; &nbsp;३) <span style=\"color:#000000\">ऑस्ट्रेलिया</span>&nbsp; &nbsp;४) <span style=\"color:#27ae60\">१३</span> <span style=\"color:#16a085\">ऑक्टोबर</span> <span style=\"color:#16a085\">१९३५</span>&nbsp; ५) <span style=\"color:#e74c3c\">५१</span> <span style=\"color:#e74c3c\">फूट</span></p>\r\n\r\n<p>&nbsp;</p>\r\n', 2, 11),
(17, '२६५ वी आजची प्रश्नमंजूषा', '24/12/2020', '<p>आजची प्रश्नमंजूषा (२६५)</p>\r\n\r\n<p>१) भारतातील एकमेव जागृत ज्वालामुखीचे नाव काय आहे ?</p>\r\n\r\n<p>२) डॉ बाबासाहेब आंबेडकरांनी लिहिलेला शेवटचा ग्रंथ कोणता ?</p>\r\n\r\n<p>३) पंचशील तत्त्वांचा पुरस्कार कोणी केला ?</p>\r\n\r\n<p>४) महानगरपालिकेचा सचिव म्हणून कोण काम&nbsp; पाहतो ?</p>\r\n\r\n<p>५) &#39;भारताचा शोध&#39; हे पुस्तक कोणी लिहिले ?</p>\r\n\r\n<p>उत्तरे :- १) <span style=\"color:#16a085\">बॅरन</span>&nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;२) <span style=\"color:#e74c3c\">बुद्ध</span> <span style=\"color:#e74c3c\">आणि</span> <span style=\"color:#e74c3c\">त्यांचा</span> <span style=\"color:#e74c3c\">धम्म</span>&nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; ३) <span style=\"color:#8e44ad\">पं</span> <span style=\"color:#8e44ad\">जवाहरलाल</span> <span style=\"color:#8e44ad\">नेहरू</span>&nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; ४) <span style=\"color:#f39c12\">महानगरपालिका</span> <span style=\"color:#f39c12\">आयुक्त</span>&nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; ५) <span style=\"color:#8e44ad\">पं</span> <span style=\"color:#8e44ad\">जवाहरलाल</span> <span style=\"color:#8e44ad\">नेहरू</span></p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</p>\r\n', 2, 11),
(18, '२६६ वी आजची प्रश्नमंजूषा', '25/12/2020', '<p>*आजची प्रश्नमंजूषा (२६६)*</p>\r\n\r\n<p>१) महानगरपालिकेचा प्रमुख प्रशासकीय अधिकारी कोण असतो ?</p>\r\n\r\n<p>२) इंग्रजीचे सर्व अक्षर ( A to Z ) असलेले वाक्य कोणते ?</p>\r\n\r\n<p>३) महापौर आपला राजीनामा कोणाकडे देतात ?</p>\r\n\r\n<p>४) पंचायतराज हा विषय कोणत्या सूचित येतो ?</p>\r\n\r\n<p>५) वाऱ्याचा वेग व दाब मोजण्यासाठी कोणते उपकरण वापरतात ?</p>\r\n\r\n<p>उत्तरे :- १) <span style=\"color:#c0392b\">महानगरपालिका</span> <span style=\"color:#c0392b\">आयुक्त</span>&nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;२) The quick brown fox jumps over the lazy dog.&nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;३) <span style=\"color:#16a085\">विभागीय</span> <span style=\"color:#16a085\">आयुक्त</span>&nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;४) <span style=\"color:#8e44ad\">राज्यसूची</span>&nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;५) <span style=\"color:#f39c12\">ऍनिमोमीटर</span></p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>\r\n', 2, 11),
(19, '२६७ वी आजची प्रश्नमंजूषा', '26/12/2020', '<p>आजची प्रश्नमंजूषा (२६७)</p>\r\n\r\n<p>१) प्रसिद्ध समाजसेवक बाबा आमटे यांचा जन्म केव्हा झाला ?</p>\r\n\r\n<p>२) महाराष्ट्रातील सर्वात जुनी ग्रामपंचायत कोणती ?</p>\r\n\r\n<p>३) डलहौसी हे थंड हवेचे ठिकाण कोणत्या राज्यात आहे ?</p>\r\n\r\n<p>४) निलगिरी पर्वतातील सर्वोच्च शिखर कोणते ?</p>\r\n\r\n<p>५) भारतातील सर्वात मोठे व उंच राष्ट्रीय उद्यान कोणते ?</p>\r\n\r\n<p>उत्तरे :- १) <span style=\"color:#c0392b\">२६</span> <span style=\"color:#c0392b\">डिसेंबर</span> <span style=\"color:#c0392b\">१९१४</span>&nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;२) <span style=\"color:#16a085\">रहिमतपूर</span>, <span style=\"color:#16a085\">सातारा</span>&nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; ३) <span style=\"color:#8e44ad\">हिमाचल</span> <span style=\"color:#8e44ad\">प्रदेश</span>&nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; ४) <span style=\"color:#2980b9\">दोडाबेटा</span>&nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;५) <span style=\"color:#d35400\">जिम</span> <span style=\"color:#d35400\">कार्बेट</span> <span style=\"color:#d35400\">राष्ट्रीय</span> <span style=\"color:#d35400\">उद्यान</span></p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>\r\n', 2, 14),
(20, '२६८ वी आजची प्रश्नमंजूषा', '27/12/2020', '<p>आजची प्रश्नमंजूषा (२६८)</p>\r\n\r\n<p>१) २०२१ साली होणारी जनगणना ही भारताची कितवी जनगणना आहे ?</p>\r\n\r\n<p>२) महाराष्ट्रातील सर्वात मोठी ग्रामपंचायत कोणती आहे ?</p>\r\n\r\n<p>३) मुलींसाठी &#39;राजश्री योजना&#39; कोणत्या राज्याने सुरू केली ?</p>\r\n\r\n<p>४) भंडारा जिल्ह्यातील मुख्य नदी कोणती आहे ?</p>\r\n\r\n<p>५) छपाईची शाई तयार करण्यासाठी मुख्यतः कशाचा वापर केला जातो ?</p>\r\n\r\n<p>उत्तरे :- १) ८ वी&nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; २) अकलूज, सोलापूर&nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; ३) राजस्थान&nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; ४) वैनगंगा&nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; ५) कार्बन</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>\r\n', 2, 9),
(21, '२६९ वी आजची प्रश्नमंजूषा', '28/12/2020', '<p>*आजची प्रश्नमंजूषा (२६९)*</p>\r\n\r\n<p>१) मुलींसाठी &#39;कन्याश्री योजना&#39; कोणत्या राज्याने सुरू केली ?<br />\r\n२) अग्निबाणात इंधन म्हणून कशाचा वापर केला जातो ?<br />\r\n३) भूल देण्यासाठी कोणत्या दोन मिश्रणाचा उपयोग केला जातो ?<br />\r\n४) प्रयोग शाळेत प्रथमतः पाणी कुणी तयार केले ?<br />\r\n५) जगप्रसिद्ध लोणार सरोवर कशामुळे तयार झाले ?</p>\r\n\r\n<p>उत्तरे :- १) <span style=\"color:#27ae60\">पश्चिम</span> <span style=\"color:#27ae60\">बंगाल</span>&nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;२) <span style=\"color:#c0392b\">द्रवरूप</span> <span style=\"color:#c0392b\">ऑक्सिजन</span>&nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;३) <span style=\"color:#8e44ad\">ऑक्सिजन</span> <span style=\"color:#8e44ad\">व</span> <span style=\"color:#8e44ad\">नायट्रस</span> <span style=\"color:#8e44ad\">ऑक्सईड</span>&nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;४) <span style=\"color:#f39c12\">हेन्री</span> <span style=\"color:#f39c12\">कॅवेंडिश</span>&nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;५) <span style=\"color:#999999\">उल्कापात</span></p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>\r\n', 2, 10),
(22, '२७० वी आजची प्रश्नमंजूषा', '29/12/2020', '<p>आजची प्रश्नमंजूषा (२७०)</p>\r\n\r\n<p>१) मुलींसाठी &#39;भाग्यलक्ष्मी योजना&#39; कोणत्या राज्याने सुरू केली ?</p>\r\n\r\n<p>२) महाराष्ट्रातील पहिले कॅशलेस गाव कोणते ?</p>\r\n\r\n<p>३) लवासा प्रकल्प कोणत्या जिल्ह्यात उभारला जात आहे ?</p>\r\n\r\n<p>४) महाराष्ट्राच्या प्रशासनातील सर्वोच्च पद कोणते ?</p>\r\n\r\n<p>५) जगात सर्वात जास्त यंत्रमानवाचा वापर करणारा देश कोणता ?</p>\r\n\r\n<p>उत्तरे :- १) <span style=\"color:#c0392b\">कर्नाटक</span>&nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;२) <span style=\"color:#27ae60\">धसई</span>, <span style=\"color:#27ae60\">पुणे</span>&nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;३) <span style=\"color:#d35400\">पुणे</span>&nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;४) <span style=\"color:#f39c12\">मुख्य</span> <span style=\"color:#f39c12\">सचिव</span>&nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;५) <span style=\"color:#8e44ad\">जपान</span></p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>\r\n', 2, 188),
(23, '२७१ वी आजची प्रश्नमंजूषा', '30/12/2020', '<p>आजची प्रश्नमंजूषा (२७१)</p>\r\n\r\n<p>१) मुलींसाठी &#39;ममता योजना&#39; कोणत्या राज्याने सुरू केली ?</p>\r\n\r\n<p>२) राष्ट्रीय ग्रामीण रोजगार हमी योजनेनुसार किती दिवस रोजगाराची हमी देण्यात आली ?</p>\r\n\r\n<p>३) चंद्राची उपभू स्थिती म्हणजे काय ?</p>\r\n\r\n<p>४) धुव्वाधार धबधबा कोणत्या नदीवर आहे ?</p>\r\n\r\n<p>५) डुरंड कप कोणत्या खेळाशी संबंधित आहे ?</p>\r\n\r\n<p>उत्तरे :- १) गोवा&nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; २) वर्षात कमीत कमी १०० दिवस&nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; ३) चंद्र पृथ्वीच्या सर्वात जवळ असतो.&nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; ४) नर्मदा नदी,मध्यप्रदेश&nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; ५) फुटबॉल</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</p>\r\n', 2, 112),
(24, '२७२ वी आजची प्रश्नमंजूषा', '31/12/2020', '<p><span style=\"color:#c0392b\">आजची</span> <span style=\"color:#c0392b\">प्रश्नमंजूषा</span> (२७२)</p>\r\n\r\n<p>१) मुलींसाठी &#39; नंदागौरी देवी कन्याधन योजना&#39; कोणत्या राज्याने सुरू केली ?</p>\r\n\r\n<p>२) चंद्राची अपभू स्थिती म्हणजे काय ?</p>\r\n\r\n<p>३) दिगबोई तेल शुद्धीकरण कारखाना कोणत्या राज्यात आहे ?</p>\r\n\r\n<p>४) डॉ बाबासाहेब आंबेडकर आंतरराष्ट्रीय विमानतळ कोठे आहे ?</p>\r\n\r\n<p>५) दिलीप ट्रॉफी कोणत्या खेळाशी संबंधित आहे ?</p>\r\n\r\n<p><span style=\"color:#16a085\">उत्तरे</span> :- १) उत्तराखंड&nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;२) चंद्र पृथ्वीपासून जास्तीत जास्त दूर असतो.&nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;३) आसाम&nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;४) नागपूर&nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;५) क्रिकेट</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>\r\n', 2, 93),
(25, '२७३ वी आजची प्रश्नमंजूषा', '०१.०१.२०२१', '<p>आजची प्रश्नमंजूषा (२७३)</p>\r\n\r\n<p>१) क्षेत्रफळाच्या दृष्टीने सर्वात लहान प्रशासकीय विभाग कोणता ?</p>\r\n\r\n<p>२) अजिंठा कशाकरिता प्रसिद्ध आहे ?</p>\r\n\r\n<p>३) आगाखान चषक कोणत्या खेळाशी संबंधित आहे ?</p>\r\n\r\n<p>४) फाउंटन पेनचा शोध कोणी लावला ?</p>\r\n\r\n<p>५) अटल पेन्शन योजना केव्हा सुरू झाली ?</p>\r\n\r\n<p>उत्तरे :- १) <span style=\"color:#c0392b\">कोकण</span>&nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; २) <span style=\"color:#16a085\">बौद्ध</span> <span style=\"color:#16a085\">लेणी</span>&nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; ३) <span style=\"color:#8e44ad\">हॉकी</span>&nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;४) <span style=\"color:#f39c12\">वाटरमॅन</span>&nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; ५) ९ <span style=\"color:#2980b9\">मे</span> <span style=\"color:#2980b9\">२०१५</span></p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>\r\n', 2, 71),
(26, '२७४ वी आजची प्रश्नमंजूषा', '02/01/2021', '<p>आजची प्रश्नमंजूषा (२७४)</p>\r\n\r\n<p>१) डेव्हिड चषक कोणत्या खेळाशी संबंधित आहे ?</p>\r\n\r\n<p>२) घड्याळचा शोध कोणी लावला ?</p>\r\n\r\n<p>३) संविधान दिवस कोणत्या नावाने ओळखले जाते ?</p>\r\n\r\n<p>४) &#39;पांढऱ्या हत्तीचा देश&#39; कोणत्या देशाला संबोधतात ?</p>\r\n\r\n<p>५) प्रधानमंत्री जन धन योजना केव्हा सुरू झाली ?</p>\r\n\r\n<p>उत्तरे :- १) <span style=\"color:#d35400\">टेनिस</span>&nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;२) <span style=\"color:#8e44ad\">ब्रगेट</span>&nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;३) <span style=\"color:#27ae60\">राष्ट्रीय</span> <span style=\"color:#27ae60\">विधी</span> <span style=\"color:#27ae60\">दिन</span>&nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; ४) <span style=\"color:#8e44ad\">थायलंड</span>&nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; ५) <span style=\"color:#c0392b\">२८</span> <span style=\"color:#c0392b\">ऑगस्ट</span> <span style=\"color:#c0392b\">२०१४</span></p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</p>\r\n', 2, 99),
(27, '२७५ वी आजची प्रश्नमंजूषा', '03/01/2021', '<p>आजची प्रश्नमंजूषा (२७५)</p>\r\n\r\n<p>१) &#39;बालिका दिवस&#39; केव्हा साजरे केले जाते ?</p>\r\n\r\n<p>२) महाराष्ट्र सरकारने २०२१ पासून ३ जानेवारी हा दिवस नव्याने कोणता दिन म्हणून साजरा करण्याचे शिक्षण विभागाला आदेश दिले आहेत ?</p>\r\n\r\n<p>३) मुलींची पहिली शाळा सुरू झाली तेव्हा सुरुवातीला शाळेत किती मुली शिक्षण घेत होत्या ?</p>\r\n\r\n<p>४) क्रांतीज्योती सावित्रीबाई फुले यांनी १८७३ साली झालेल्या कोणत्या सत्यशोधक समाज परिषदेचे अध्यक्षपद भूषविले होते ?</p>\r\n\r\n<p>५) शिक्षणापासून वंचित मुलींसाठी महाराष्ट्र शासनाने कोणती योजना सुरू केली ?</p>\r\n\r\n<p>उत्तरे :- १) <span style=\"color:#c0392b\">३</span> <span style=\"color:#c0392b\">जानेवारी</span>&nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; २) <span style=\"color:#8e44ad\">महिला</span> <span style=\"color:#8e44ad\">शिक्षण</span> <span style=\"color:#8e44ad\">दिन</span>&nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; ३) <span style=\"color:#27ae60\">६</span> <span style=\"color:#27ae60\">मुली</span>&nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; ४) <span style=\"color:#2980b9\">सासवड</span>&nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; ५) <span style=\"color:#f39c12\">सावित्रीबाई</span> <span style=\"color:#f39c12\">फुले</span> <span style=\"color:#f39c12\">दत्तक</span> <span style=\"color:#f39c12\">पालक</span> <span style=\"color:#f39c12\">योजना</span></p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>\r\n', 2, 119),
(28, '२७६ वी आजची प्रश्नमंजूषा', '04/01/2021', '<p>आजची प्रश्नमंजूषा (२७६)</p>\r\n\r\n<p>१) देशातील सर्वात तरुण महापौर कोण ?</p>\r\n\r\n<p>२) महाराष्ट्राचे मुख्य शिक्षण सचिव कोण आहेत ?</p>\r\n\r\n<p>३) देशाचे पहिले कृषिमंत्री कोण होते ?</p>\r\n\r\n<p>४) बंदुका कोणत्या वृक्षाच्या लाकडापासून तयार करतात ?</p>\r\n\r\n<p>५) बळीवंश या पुस्तकाचे लेखक कोण आहेत ?</p>\r\n\r\n<p>उत्तरे :- १) <span style=\"color:#c0392b\">आर्या</span> <span style=\"color:#c0392b\">राजेंद्रन</span> , <span style=\"color:#c0392b\">केरळ</span>&nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;२) <span style=\"color:#8e44ad\">वंदना</span> <span style=\"color:#8e44ad\">कृष्णा</span>&nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;३) डॉ <span style=\"color:#27ae60\">पंजाबराव</span> <span style=\"color:#27ae60\">देशमुख</span>&nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;४) <span style=\"color:#f39c12\">अक्रोड</span>&nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;५) डॉ आ ह <span style=\"color:#2980b9\">साळुंखे</span></p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>\r\n', 2, 96),
(29, '२७७ वी आजची प्रश्नमंजूषा', '05/01/2021', '<p>आजची प्रश्नमंजूषा (२७७)</p>\r\n\r\n<p>१) भारतीय संविधान सभेचे अस्थायी अध्यक्ष कोण होते ?</p>\r\n\r\n<p>२) दुर्बीणचा शोध कोणी लावला ?</p>\r\n\r\n<p>३) व्हिटामिन &#39;बी&#39; चे अविष्कारक कोण आहेत ?</p>\r\n\r\n<p>४) शाळा या पुस्तकाचे लेखक कोण आहेत ?</p>\r\n\r\n<p>५) सोमनाथ ज्योतिर्लिंग कोणत्या राज्यात आहे ?</p>\r\n\r\n<p>उत्तरे :- १) <span style=\"color:#c0392b\">डॉ</span> <span style=\"color:#c0392b\">सच्चिदानंद</span> <span style=\"color:#c0392b\">सिन्हा</span>&nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; २) <span style=\"color:#8e44ad\">गॅलिलिओ</span>&nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; ३) <span style=\"color:#2980b9\">मॅकुलन</span>&nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; ४) <span style=\"color:#27ae60\">मिलिंद</span> <span style=\"color:#27ae60\">बोकील</span>&nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; ५) <span style=\"color:#f39c12\">गुजरात</span></p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>\r\n', 2, 96),
(30, '२७७ वी आजची प्रश्नमंजूषा', '06/01/2021', '<p>आजची प्रश्नमंजूषा (२७८)</p>\r\n\r\n<p>१) मंडो नृत्य कोणत्या राज्याशी संबंधित आहे ?</p>\r\n\r\n<p>२) छत्रपती शिवाजी महाराज आंतरराष्ट्रीय विमानतळ कोठे आहे ?</p>\r\n\r\n<p>३) थॉमस चषक कोणत्या खेळाशी संबंधित आहे ?</p>\r\n\r\n<p>४) &#39;सिक्कीमीज स्पायनर&#39; या नावाने कोण ओळखले जाते ?</p>\r\n\r\n<p>५) काटेपूर्णा अभयारण्य महाराष्ट्रातील कोणत्या जिल्ह्यात आहे ?</p>\r\n\r\n<p>उत्तरे :- १) <span style=\"color:#c0392b\">गोवा</span>&nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; २) <span style=\"color:#8e44ad\">मुंबई</span>&nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; ३) <span style=\"color:#f39c12\">बॅडमिंटन</span>&nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; ४) <span style=\"color:#16a085\">बाईचिंग</span> <span style=\"color:#16a085\">भूतिया</span>&nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; ५) <span style=\"color:#8e44ad\">अकोला</span></p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>\r\n', 2, 96),
(31, '२७९ वी आजची प्रश्नमंजूषा', '07/01/2021', '<p>आजची प्रश्नमंजूषा (२७९)</p>\r\n\r\n<p>१) महाराष्ट्रात राष्ट्रपती राजवट कोणत्या वर्षी लागली होती ?</p>\r\n\r\n<p>२) महाराष्ट्रातील सर्वात जास्त जिल्हे असणारा प्रशासकीय विभाग कोणता ?</p>\r\n\r\n<p>३) डॉ बाबासाहेब आंबेडकर तंत्रज्ञान विद्यापीठाचे मुख्यालय कोठे आहे ?</p>\r\n\r\n<p>४) वाकर कप कोणत्या खेळाशी संबंधित आहे ?</p>\r\n\r\n<p>५) नळदुर्ग हा किल्ला कोणत्या जिल्ह्यात आहे ?</p>\r\n\r\n<p>उत्तरे :- १) <span style=\"color:#8e44ad\">१९८०</span> व <span style=\"color:#8e44ad\">२०१९</span>&nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; २) <span style=\"color:#8e44ad\">औरंगाबाद</span>&nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; ३) <span style=\"color:#8e44ad\">लोनेरे</span>&nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; ४) <span style=\"color:#8e44ad\">गोल्फ</span>&nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; ५) <span style=\"color:#8e44ad\">उस्मानाबाद</span></p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>\r\n', 2, 115),
(32, '२८० वी आजची प्रश्नमंजूषा', '08/01/2021', '<p>आजची प्रश्नमंजूषा (२८०)</p>\r\n\r\n<p>१) महाराष्ट्रातील चेसचा पहिला ग्रँडमास्टर कोण ?</p>\r\n\r\n<p>२) अणुऊर्जा आयोगाची स्थापना कोणत्या वर्षी झाली ?</p>\r\n\r\n<p>३) महाराष्ट्र केसरी २०२० हा किताब कोणी मिळवला ?</p>\r\n\r\n<p>४) &#39;ज्वाला आणि फुले&#39; या पुस्तकाचे लेखक कोण ?</p>\r\n\r\n<p>५) भरतनाट्यम नृत्य कोणत्या राज्याशी संबंधित आहे ?</p>\r\n\r\n<p>उत्तरे :- १) <span style=\"color:#8e44ad\">प्रवीण</span> <span style=\"color:#8e44ad\">ठिपसे</span>&nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; २) <span style=\"color:#8e44ad\">१९४८</span></p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; ३) <span style=\"color:#8e44ad\">हर्षवर्धन</span> <span style=\"color:#8e44ad\">सदगीर</span>&nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; ४) <span style=\"color:#8e44ad\">बाबा</span> <span style=\"color:#8e44ad\">आमटे</span>&nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; ५) <span style=\"color:#8e44ad\">तामिळनाडू</span></p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>\r\n', 2, 95),
(33, '२८१ वी आजची प्रश्नमंजूषा', '09/01/2021', '<p>आजची प्रश्नमंजूषा (२८१)</p>\r\n\r\n<p>१) अणुऊर्जा आयोगाचे पहिले अध्यक्ष कोण होते ?</p>\r\n\r\n<p>२) राष्ट्रकुल क्रीडा स्पर्धा दर किती वर्षांनी होतात ?</p>\r\n\r\n<p>३) &#39;काळे सोने&#39; कशाला म्हणतात ?</p>\r\n\r\n<p>४) &#39;जीव विज्ञान&#39; या शब्दाचा सर्वप्रथम वापर कोणी केला ?</p>\r\n\r\n<p>५) सरदार पटेल आंतरराष्ट्रीय विमानतळ कोठे आहे ?</p>\r\n\r\n<p>उत्तरे :- १) डॉ होमी भाभा&nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; २) चार&nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; ३) खनिजतेल&nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; ४) लेमार्क व ट्रेविरेनस&nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; ५) अहमदाबाद</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</p>\r\n', 2, 151),
(34, '२८२ वी आजची प्रश्नमंजूषा', '10/01/2021', '<p>आजची प्रश्नमंजूषा (२८२)</p>\r\n\r\n<p>१) &#39;अमृतवेल&#39; या पुस्तकाचे लेखक कोण आहेत ?</p>\r\n\r\n<p>२) भारतात सर्वात उंच झेंडा कोठे फडकतो ?</p>\r\n\r\n<p>३) भूपृष्ठापासून पृथ्वीच्या केंद्रापर्यंतचे अंतर किती किमी आहे ?</p>\r\n\r\n<p>४) नैसर्गिक वायूमध्ये कोणता घटक मुख्य असतो ?</p>\r\n\r\n<p>५) काशी विश्वेश्वर ज्योतिर्लिंग कोणत्या राज्यात आहे ?</p>\r\n\r\n<p>उत्तरे :- १) वि. स.खांडेकर&nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; २) वाघा-अटारी बॉर्डर&nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; ३) ६३७३ किमी</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; ४) मिथेन&nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; ५) उत्तरप्रदेश</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</p>\r\n', 2, 123),
(35, '२८३ वी आजची प्रश्नमंजूषा', '11/01/2021', '<p>आजची प्रश्नमंजूषा (२८३)</p>\r\n\r\n<p>१) सर्वात जास्त शब्द असलेली भाषा कोणती ?</p>\r\n\r\n<p>२) ओझोनच्या थरासाठी कोणता वायू घातक आहे ?</p>\r\n\r\n<p>३) कळसूबाई या शिखराची उंची किती आहे ?</p>\r\n\r\n<p>४) ओरस बुद्रुक हे कोणत्या जिल्ह्याचे मुख्य ठिकाण आहे ?</p>\r\n\r\n<p>५) धुळे जिल्ह्यातील आंतरराष्ट्रीय कीर्तीचे शिल्पकार कोण ?</p>\r\n\r\n<p>उत्तरे :- १) इंग्रजी&nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; २) CO2&nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; ३) १६४६ मी&nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; ४) सिंधुदुर्ग&nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; ५) राम सुतार</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>\r\n', 2, 122),
(36, '२८४ वी आजची प्रश्नमंजूषा', '12/01/2021', '<p>आजची प्रश्नमंजूषा (२८४)</p>\r\n\r\n<p>१) भारतीय संविधान सभेच्या सल्लागार समितीचे अध्यक्ष कोण होते ?</p>\r\n\r\n<p>२) पृथ्वीवरचे जमिनीचे अचूक प्रमाण किती टक्के आहे ?</p>\r\n\r\n<p>३) LPG गॅसची गळती कळण्यासाठी त्यात कोणते रसायन मिसळले जाते ?</p>\r\n\r\n<p>४) महाराष्ट्रातील श्रमविकासाचे आदर्श गाव कोणते ?</p>\r\n\r\n<p>५) &#39;वाट तुडवितांना&#39; या पुस्तकाचे लेखक कोण आहे ?</p>\r\n\r\n<p>उत्तरे :- १) डॉ बी एन राव&nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; २) २९.२०%&nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; ३) इथिल मरकॅप्टन&nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; ४) राळेगणसिद्धी&nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; ५) उत्तम कांबळे</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>\r\n', 2, 67),
(37, '२८५ वी आजची प्रश्नमंजूषा', '13/01/2021', '<p>आजची प्रश्नमंजूषा (२८५)</p>\r\n\r\n<p>१) कसोटी क्रिकेटमध्ये सर्वाधिक चेंडू खेळण्याचा विश्वविक्रम कोणी केला ?<br />\r\n२) २६ जानेवारी २०२१ ला प्रजासत्ताक सोहळ्याला प्रमुख पाहुणे म्हणून कोणाला आमंत्रित करण्यात आले आहे ?<br />\r\n३) भारतीय संविधान सभेचे स्थायी अध्यक्ष कोण होते ?<br />\r\n४) केदारनाथ ज्योतिर्लिंग कोणत्या राज्यात आहे ?<br />\r\n५) डायलिसिस उपचार कोणत्या आजारात करतात ?</p>\r\n\r\n<p>उत्तरे :- १) राहुल द्रविड&nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; २) चंद्रिकाप्रसाद संतोखी, राष्ट्रपती, सुरीनाम&nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; ३) डॉ राजेंद्र प्रसाद&nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; ४) उत्तराखंड&nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; ५) मूत्रपिंडाचे विकार</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</p>\r\n', 2, 77),
(38, '२८६ वी आजची प्रश्नमंजूषा', '14/01/2021', '<p>आजची प्रश्नमंजूषा (२८६)</p>\r\n\r\n<p>१) १९५२ मध्ये कोलंबिया विद्यापीठाने डॉ बाबासाहेब आंबेडकरांना कोणती पदवी बहाल केली ?</p>\r\n\r\n<p>२) माती नमुना घेण्यासाठी कोणते उपकरण वापरतात ?</p>\r\n\r\n<p>३) ग्रीक व रोमन शैलीच्या प्रभावाने निर्माण झालेली भारतीय कलाशैली कोणती ?</p>\r\n\r\n<p>४) बुलढाणा जिल्ह्याचे पूर्वीचे नाव काय होते ?</p>\r\n\r\n<p>५) कावीळ हा रोग मुख्यत्वे कशामुळे होतो ?</p>\r\n\r\n<p>उत्तरे :- १) L. L. D.&nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;२) स्क्रूआगर&nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; ३) गांधारशैली&nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; ४) भिलठाण&nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; ५) दूषित पाणी</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</p>\r\n', 2, 50),
(39, '२८७ वी आजची प्रश्नमंजूषा', '15/01/2021', '<p>आजची प्रश्नमंजूषा (२८७)</p>\r\n\r\n<p>१) &quot;प्रस्तावना ही भारतीय संविधानाची किल्ली (key) आहे&quot; , असे कोणी म्हटले आहे ?</p>\r\n\r\n<p>२) खान्देशी जिल्हा म्हणून कोणता जिल्हा प्रख्यात आहे ?</p>\r\n\r\n<p>३) गौताळा अभयारण्य कोणत्या जिल्ह्यात आहे ?</p>\r\n\r\n<p>४) रुपया हे १०० पैशात केव्हा विभाजित झाला ?</p>\r\n\r\n<p>५) &#39;युगंधर&#39; या पुस्तकाचे लेखक कोण आहे ?</p>\r\n\r\n<p>उत्तरे :- १) डॉ बाबासाहेब आंबेडकर&nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; २) जळगाव&nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;३) औरंगाबाद&nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;४) १९५७&nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; ५) शिवाजी सावंत</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>\r\n', 2, 72),
(40, '२८८ वी आजची प्रश्नमंजूषा', '16/01/2021', '<p>आजची प्रश्नमंजूषा (२८८)</p>\r\n\r\n<p>१) भारतीय राज्यघटनेमध्ये सुरूवातीला एकूण किती कलमे, भाग व परिशिष्टे होती ?</p>\r\n\r\n<p>२) &#39;महानायक&#39; या पुस्तकाचे लेखक कोण ?</p>\r\n\r\n<p>३) मनुष्याच्या गुणसूत्रांची संख्या किती आहे ?</p>\r\n\r\n<p>४) कोणत्या मूलद्रव्याची घनता सर्वात जास्त असते ?</p>\r\n\r\n<p>५) कोणते झाड इतरांहून जलद वाढते ?</p>\r\n\r\n<p>उत्तरे :- १) ३९२ कलमे,२२ भाग व ८ परिशिष्टे</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; २) विश्वास पाटील&nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;३) ४६&nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;४) पारा&nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; ५) निलगिरी</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</p>\r\n', 2, 33);
